<title>tú đz</title>
<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.0.0-beta3/css/all.min.css">
<style>
    body {
        font-family: Arial, sans-serif;
        margin: 0;
        padding: 0;
        display: flex;
        justify-content: center;
        align-items: center;
        height: 100vh;
    }
    
    .profile {
        width: 80%;
        max-width: 800px;
        padding: 20px;
        border-radius: 10px;
        box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
        text-align: center;
    }

    .profile img {
        width: 150px;
        height: 150px;
        border-radius: 50%;
        margin-bottom: 20px;
        box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
        display: block;
        margin: 0 auto 20px;
    }
    
    .profile h2 {
        margin: 10px 0;
        color: #333;
    }
    
    .profile .verified {
        color: #007bff;
        margin-left: 5px;
    }
    
    .profile p {
        margin-bottom: 10px;
        color: #666;
    }
    
    .profile p strong {
        color: #333;
    }
    
    .support-fb-btn, .support-zalo-btn, .settings-btn {
        background-color: #007bff;
        color: #fff;
        padding: 10px 20px;
        border-radius: 5px;
        text-decoration: none;
        display: inline-block;
        margin: 10px;
        position: relative;
        overflow: hidden;
    }

    .support-fb-btn::before, .support-zalo-btn::before, .settings-btn::before {
        content: '';
        position: absolute;
        top: -2px;
        left: -2px;
        width: calc(100% + 4px);
        height: calc(100% + 4px);
        background-color: #ff0000;
        z-index: -1;
        animation: rainbowBorder 10s infinite;
    }

    @keyframes rainbowBorder {
        0% { transform: rotate(0deg); }
        100% { transform: rotate(360deg); }
    }
    
    .fb-icon, .zalo-icon, .settings-icon {
        margin-right: 5px;
    }

    .support-fb-btn::after, .support-zalo-btn::after, .settings-btn::after {
        content: '';
        position: absolute;
        top: -50%;
        left: -50%;
        width: 200%;
        height: 200%;
        background: linear-gradient(45deg, #ff0000, #ff7f00, #ffff00, #00ff00, #0000ff, #4b0082, #9400d3, #ff0000);
        animation: gradientBorder 3s linear infinite;
        border-radius: 50%;
        z-index: -1;
        opacity: 0;
    }

    @keyframes gradientBorder {
        0%, 100% {
            transform: rotate(0deg);
        }
        50% {
            transform: rotate(180deg);
        }
    }

    .support-fb-btn:hover::after, .support-zalo-btn:hover::after, .settings-btn:hover::after {
        opacity: 1;
    }
</style>
</head>
